import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontBox } from "./fontBox";

interface FontListProps {
    title: string;
    previewText: string;
    fontSize: number;
    data: string[];
}

export const FontList: React.FC<FontListProps> = ({ title,previewText,fontSize, data }) => {

    return (
        <>
        <HeaderFontPreview title={title}/>

            <ul>
            {data.map((font, index) => (
                <li className="mb-4 border p-2">
                <FontBox fontName={font} previewText={previewText} fontSize={fontSize}/>
                </li>
            ))}
            </ul>

        </>
    );
};
